ky smooth plumage by comparison. The upperparts </tspan><tspan x="0" y="32.4" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">have a blue or blue-green sheen, while the underparts have a more greenish tint </tspan><tspan x="0" y="48.6" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">to the black. The eyes are dark brown. The differences are often only really </tspan><tspan x="0" y="64.8" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">apparent between the two species when seen side by side or when heard calling. </tspan><tspan x="0" y="81" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">The bill is usually somewhat slimmer than the American crow, but is only readily </tspan><tspan x="0" y="97.2" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">distinguishable if both species are seen together</tspan></text>	</g>	<rect x="37.4" y="55" display="inline" fill="none" width="458.9" height="37"/>			<text id="name" transform="matrix(1 0 0 1 198.3098 77.8237)" display="inline" fill="#603813" font-family="'TwCenMT-Regular'" font-size="36px">Fish Crow</text>	<rect x="119.7" y="545" display="inline" fill="none" width="294.3" height="28"/>			<text id="scientificName" transform="matrix(1 0 0 1 190.2718 562.0371)" display="inline" fill="#603813" font-family="'Parisienne-Regular'" font-size="26px">Corvus ossifragus</text></g><g id="Descriptions" display="none">			<text id="graphName" transform="matrix(1 0 0 1 539.22 146.9308)" display="inline" fill="#603813" font-family="'TwCenMT-Bold'" font-size="26px">{{   chosenItemInfo[chosenItem].text   }}</text>	<g id="SpeciesNumberDescription" onload="v-show=chosenItem=='SpeciesNumber'" display="inline">		<rect x="654.6" y="578" fill="none" width="291.9" height="49.8"/>		<text transform="matrix(1 0 0 1 654.5771 585.6074)"><tspan x="0" y="0" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="12px">The sum of all observed individuals f
